package repo

import (
	"database/sql"
	"github.com/stretchr/testify/assert"
	"log"
	"os"
	"testing"
)

var repo *AvatarRepo

func TestMain(m *testing.M) {
	dsn := "gyun@tcp(localhost:3306)/balansnack"

	db, err := sql.Open("mysql", dsn)
	if err != nil {
		log.Printf("failed to connect to database: %s", err)
		os.Exit(1)
	}

	repo = NewAvatarRepo(db)

	var code int
	for {
		code = m.Run()
		if code != 0 {
			break
		}
	}

	db.Close()

	os.Exit(code)
}

func TestAvatarRepo_Create(t *testing.T) {
	nickname := "kevin"
	base64 := ""
	profile := &base64

	avatar, err := repo.Create(nickname, profile)
	if err != nil {
		t.Fatal(err)
	}
	defer func() {
		err = repo.Delete(avatar.ID)
		if err != nil {
			t.Log(err)
		}
	}()

	got, err := repo.GetByID(avatar.ID)
	if err != nil {
		t.Error(err)
		return
	}

	assert.Equal(t, nickname, got.Nickname)
	assert.Equal(t, getProfile(profile), got.GetProfile())

	nickname = "julia"
	profile = nil

	avatar, err = repo.Create(nickname, profile)
	if err != nil {
		t.Error(err)
		return
	}
	defer func() {
		err = repo.Delete(avatar.ID)
		if err != nil {
			t.Log(err)
		}
	}()

	got, err = repo.GetByID(avatar.ID)
	if err != nil {
		t.Error(err)
		return
	}

	assert.Equal(t, profile, got.Profile)

	err = repo.CheckDuplicateNickname("bill")
	assert.Nil(t, err)

	err = repo.CheckDuplicateNickname("kevin")
	assert.NotNil(t, err)

	avatar, err = repo.Create(nickname, profile)
	assert.NotNil(t, err)
}

func getProfile(profile *string) string {
	if profile == nil {
		return ""
	}
	return *profile
}